import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class Aggregate extends Component {
  render(){
    return(
      <div style={{width:'40%',display:'inline-block'}}>
        <h2>Number Text</h2>
      </div>
    )
  }
}

class Filter extends Component{
  render() {
    return (
      <div>
        <img></img>
        <input type="text"/>
      </div>
    )
  }
}

class App extends Component {
  render() {
    let color = "yellow"
    return (
      <div className="App">
        <h1>Title</h1>
      </div>
    );
  }
}

export default App;
